import React from 'react';
import Grid from '@material-ui/core/Grid';


export default class DashboardPage extends React.Component {
    render() {
        return (
            <div>
                <Grid container alignItems="center">
                    <h2>Filter on:</h2>
                </Grid>
            </div>
        );
    }
}
